import React, { useEffect, useState } from 'react';
import UserSidebar from '../../components/UserSidebar/UserSidebar';
import { useCart } from '../../context/CartContext';
import './Wishlist.scss';

interface Product {
    id: string;
    name: string;
    sku: string;
    price: {
        regularPrice: {
            amount: {
                value: number;
                currency: string;
            };
        };
    };
}

interface WishlistItem {
    id: string;
    product: Product;
}

interface Wishlist {
    id: string;
    items: WishlistItem[];
}

const Wishlist: React.FC = () => {
    const [wishlists, setWishlists] = useState<Wishlist[]>([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState<string | null>(null);
    const { addItem } = useCart();

    useEffect(() => {
        const fetchWishlists = async () => {
            const token = sessionStorage.getItem('auth_token');
            if (!token) {
                setError("User is not logged in.");
                setLoading(false);
                return;
            }

            const query = `
                query {
                    customer {
                        wishlists {
                            id
                            items {
                                id
                                product {
                                    id
                                    name
                                    sku
                                    price {
                                        regularPrice {
                                            amount {
                                                value
                                                currency
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            `;

            try {
                const response = await fetch('http://mint.local/graphql', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${token}`,
                    },
                    body: JSON.stringify({ query }),
                });

                const result = await response.json();
                if (result.data && result.data.customer) {
                    setWishlists(result.data.customer.wishlists);
                } else {
                    setError("Failed to fetch wishlists.");
                }
            } catch (err) {
                setError("Error fetching wishlists: " + err);
            } finally {
                setLoading(false);
            }
        };

        fetchWishlists();
    }, []);

    const removeFromWishlist = async (wishlistId: string, itemId: string) => {
        const token = sessionStorage.getItem('auth_token');
        if (!token) {
            setError("User is not logged in.");
            return;
        }

        const mutation = `
            mutation {
                removeProductsFromWishlist(
                    wishlistId: "${wishlistId}",
                    wishlistItemsIds: ["${itemId}"]
                ) {
                    wishlist {
                        id
                        items_count
                        items {
                            id
                            product {
                                name
                                sku
                                id
                            }
                        }
                    }
                    user_errors {
                        code
                        message
                    }
                }
            }
        `;

        try {
            const response = await fetch('http://mint.local/graphql', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${token}`,
                },
                body: JSON.stringify({ query: mutation }),
            });

            const result = await response.json();

            if (response.ok && result.data && result.data.removeProductsFromWishlist) {
                const { wishlist, user_errors } = result.data.removeProductsFromWishlist;

                if (user_errors.length > 0) {
                    setError(user_errors[0].message);
                } else {
                    setWishlists((prevWishlists) =>
                        prevWishlists.map((wishlistItem) => {
                            if (wishlistItem.id === wishlistId) {
                                return {
                                    ...wishlistItem,
                                    items: wishlistItem.items.filter(item => item.id !== itemId),
                                };
                            }
                            return wishlistItem;
                        })
                    );
                }
            } else {
                setError(result.errors ? result.errors[0].message : "Failed to remove item from wishlist.");
            }
        } catch (err) {
            console.error("Fetch error:", err);
            setError("Error removing item from wishlist: " + err);
        }
    };

    const addToCart = async (sku: string, quantity: number = 1, wishlistId: string, itemId: string) => {
        await addItem(sku, quantity);

        await removeFromWishlist(wishlistId, itemId);
    };

    return (
        <div className="wish-list">
            <UserSidebar />

            <div className="wish-list__content">
                <h2>My Wish List</h2>
                <section>
                    {loading && <p>Loading...</p>}
                    {error && <p>{error}</p>}

                    {wishlists.length > 0 ? (
                        wishlists.map((wishlist) => (
                            <div key={wishlist.id}>
                                <ul>
                                    {wishlist.items.map((item: WishlistItem) => (
                                        <li key={item.id}>
                                            <h4>{item.product.name}</h4>
                                            <p>SKU: {item.product.sku}</p>
                                            <p>Price: {item.product.price.regularPrice.amount.value} {item.product.price.regularPrice.amount.currency}</p>
                                            <button onClick={() => addToCart(item.product.sku, 1, wishlist.id, item.id)}>
                                                Add to Cart
                                            </button>
                                            <button onClick={() => removeFromWishlist(wishlist.id, item.id)}>
                                                Remove from Wishlist
                                            </button>
                                        </li>
                                    ))}
                                </ul>
                            </div>
                        ))
                    ) : (
                        <p>You have no items in your wish list.</p>
                    )}
                </section>
            </div>
        </div>
    );
};

export default Wishlist;
